import React, { useState } from 'react';

const ProductListPage = () => {
    const [searchTerm, setSearchTerm] = useState('');

    // Sample random car data
    const cars = [
        { id: 1, name: 'Tesla Model S', imageUrl: 'https://via.placeholder.com/300', description: 'Electric sedan with autopilot.' },
        { id: 2, name: 'Ford Mustang', imageUrl: 'https://via.placeholder.com/300', description: 'Classic muscle car with a powerful engine.' },
        { id: 3, name: 'Toyota Supra', imageUrl: 'https://via.placeholder.com/300', description: 'Sports car known for its speed.' },
        { id: 4, name: 'BMW X5', imageUrl: 'https://via.placeholder.com/300', description: 'Luxury SUV with high performance.' },
        { id: 5, name: 'Audi A8', imageUrl: 'https://via.placeholder.com/300', description: 'Premium sedan with advanced features.' },
        { id: 6, name: 'Mercedes-Benz G-Class', imageUrl: 'https://via.placeholder.com/300', description: 'Off-road vehicle with luxury touches.' }
    ];

    // Filter cars based on search term
    const filteredCars = cars.filter(car =>
        car.name.toLowerCase().includes(searchTerm.toLowerCase())
    );

    return (
        <div className="container mx-auto py-8 px-4">
            <h1 className="text-3xl font-bold mb-6 text-gray-800">My Cars</h1>

            {/* Search Bar */}
            <div className="mb-6">
                <input
                    type="text"
                    placeholder="Search cars..."
                    className="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:border-blue-500"
                    value={searchTerm}
                    onChange={(e) => setSearchTerm(e.target.value)}
                />
            </div>

            {/* Car List */}
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
                {filteredCars.map((car) => (
                    <div key={car.id} className="bg-white shadow-lg rounded-lg overflow-hidden">
                        <img src={car.imageUrl} alt={car.name} className="w-full h-48 object-cover"/>
                        <div className="p-4">
                            <h3 className="text-xl font-semibold text-gray-700">{car.name}</h3>
                            <p className="text-gray-600 mt-2">{car.description}</p>
                        </div>
                    </div>
                ))}
            </div>

            {/* No Results Message */}
            {filteredCars.length === 0 && (
                <div className="text-center text-gray-500 mt-8">
                    No cars found.
                </div>
            )}
        </div>
    );
};

export default ProductListPage;
